import React, { useState, useEffect } from 'react';
import api from '../services/api';

function ItineraryManager({ tripId }) {
  const [activities, setActivities] = useState([]);
  const [name, setName] = useState('');
  const [date, setDate] = useState('');
  const [time, setTime] = useState('');
  const [location, setLocation] = useState('');

  // Fetch activities for the trip when the component loads
  useEffect(() => {
    fetchActivities();
  }, []);

  const fetchActivities = async () => {
    try {
      const response = await api.get(`/trips/${tripId}/itinerary`);
      setActivities(response.data);
    } catch (error) {
      console.error('Failed to load activities:', error);
    }
  };

  const createActivity = async () => {
    try {
      await api.post(`/trips/${tripId}/itinerary/activities`, {
        name,
        date,
        time,
        location,
      });
      fetchActivities();  // Refresh activities list after creation
      setName('');  // Clear input fields
      setDate('');
      setTime('');
      setLocation('');
    } catch (error) {
      console.error('Failed to create activity:', error);
    }
  };

  return (
    <div>
      <h2>Itinerary for Trip {tripId}</h2>
      <div>
        <input type="text" placeholder="Activity Name" value={name} onChange={(e) => setName(e.target.value)} />
        <input type="date" value={date} onChange={(e) => setDate(e.target.value)} />
        <input type="time" value={time} onChange={(e) => setTime(e.target.value)} />
        <input type="text" placeholder="Location" value={location} onChange={(e) => setLocation(e.target.value)} />
        <button onClick={createActivity}>Add Activity</button>
      </div>
      <h3>Activities</h3>
      <ul>
        {activities.length > 0 ? (
          activities.map((activity) => (
            <li key={activity.id}>
              {activity.name} - {activity.date} at {activity.time} in {activity.location}
            </li>
          ))
        ) : (
          <p>No activities found for this trip.</p>
        )}
      </ul>
    </div>
  );
}

export default ItineraryManager;

